import styled from 'styled-components';
import theme from '../../../theme/theme';

const HomePageStyled = styled.div`
  section#intro-zn {

    img {
      max-width: 100vw;
    }

    div.intro-zn--text-zn {
      h1 {
        font-family: theme.special;
      }
    }
